					Value = "-1",
					Text = " Nhãn hiệu ",
					Selected = "-1" == brand.ToString(),
				});

		foreach (var br in lstBrand.Distinct())
		{
			if (StoreItems.FirstOrDefault(c => c.Value == br.Id.ToString()) == null)
			{
				StoreItems.Add(new SelectListItem()
						{
							Value = br.Id.ToString(),
							Text = br.Name,
							Selected = br.Id == brand,
						});
			}
